import { React, Component } from 'react';
import './list.scss';
class List extends Component {
	constructor(props) {
		super(props);
	}
	state = {};
	render() {
		return (
			<>
				<ul>
					<li className='todo-item'>
						<div className='todo-content'>Học Js</div>
						<div className='todo-status completed'>Completed</div>
						<div className='todo-action'>
							<a className='todo-edit'>Edit</a>
							<a className='todo-delete'>Success</a>
						</div>
					</li>

					<li className='todo-item'>
						<div className='todo-content'>Học react</div>
						<div className='todo-status process'>Process</div>
						<div className='todo-action'>
							<a className='todo-edit'>Edit</a>
							<a className='todo-delete'>Delete</a>
						</div>
					</li>

					<li className='todo-item'>
						<div className='todo-content'>Học Redux saga</div>
						<div className='todo-status todo'>Todo</div>
						<div className='todo-action'>
							<button className='todo-edit'>Edit</button>
							<button className='todo-delete'>Delete</button>
						</div>
					</li>
				</ul>
			</>
		);
	}
}

export default List;
